![Raster + vector layer](08-mapping_files/figure-html/fig-plot-raster-and-vector-output-1.png){#fig-plot-raster-and-vector-1 width=334 height=442}
:::

::: {.cell-output .cell-output-display}
![Raster + computed vector layer](08-mapping_files/figure-html/fig-plot-raster-and-vector-output-2.png){#fig-plot-raster-and-vector-2 width=314 height=442}
