!['Stamen Terrain' basemap (the default)](08-mapping_files/figure-html/fig-basemap-output-1.png){#fig-basemap-1 width=519 height=590}
:::

::: {.cell-output .cell-output-display}
!['OpenStreetMap' basemap](08-mapping_files/figure-html/fig-basemap-output-2.png){#fig-basemap-2 width=519 height=590}
:::

::: {.cell-output .cell-output-display}
